import React, { Component } from 'react'
import { Card, Col, Row, Icon } from 'antd'
class PageIndex extends Component {
    render() {
        return (<div>
            <Card>
                <h2>ทำแบบประเมิน</h2>
            </Card>
            <Card>
                <h2>Report</h2>
            </Card>
        </div>)
    }
}

export default PageIndex;
